//DMX SOUND OPTIONS


//SELECT ALTERNATE SOUNDS TO USE DMX SOUND VERSION A OR B
//Original taiko sounds are "se_don.ogg" and "se_ka.ogg" and "neiro_1_don" and "neiro_1_ka"
var useDon = "A";
var useKa = "A";

function don() 					{if (useDon == "A") return se_uhA();else if (useDon == "B") return se_uhB();}
function ka() 					{if (useKa == "A") return se_whatA();else if (useKa == "B") return se_whatB();}
function songstart()			{return se_comeon();}
function diffsel()				{return se_growl();}
function songsel()				{return se_letsgetiton();}
function balloon()				{return se_arfarf();}
function results_fullcombo()	{return se_imthebest();}
function results_fullcombo2()	{return se_stopdropopenupshop();}
function fullcombo()			{return se_dogfolife();}
function gamefail()				{return se_youstillplayingames();}
function results()				{return se_keepitreal();}
function combo_50()				{return se_bgcomeon();}
function combo_100()			{return se_whaa();}
function combo_200()			{return se_whaat();}
function combo_300()			{return se_whaatreverb();}
function combo_400()			{return se_onemotime();}
